import { Avatar, Grid, List, TextField } from '@material-ui/core';
import React from 'react';
import nikklaus from './nikklaus.jpg'
const Posts = () => {
    return (
        <Grid container style={{marginTop:
        '20px'}}>     
    <Avatar src={nikklaus} />       
    <input style={{width:'300px', border:'1rem'}} type="text"/>


      </Grid>
     );
}
 
export default Posts;
